```python
def solve_equation(a, b, n):
    # Check if a and b are both zero
    if a == 0 and b == 0:
        return None

    # Check if a is zero
    if a == 0:
        if n % b == 0:
            return (0, n // b)
        else:
            return None

    # Check if b is zero
    if b == 0:
        if n % a == 0:
            return (n // a, 0)
        else:
            return None

    # Find the greatest common divisor of a and b
    gcd = find_gcd(a, b)

    # Check if n is divisible by the gcd
    if n % gcd != 0:
        return None

    # Divide both sides of the equation by the gcd
    a //= gcd
    b //= gcd
    n //= gcd

    # Use the extended Euclidean algorithm to find x and y
    x, y = extended_euclidean(a, b)

    # Multiply x and y by n to get the final solution
    x *= n
    y *= n

    return (x, y)


def find_gcd(a, b):
    while b != 0:
        a, b = b, a % b
    return a


def extended_euclidean(a, b):
    if b == 0:
        return (1, 0)
    else:
        x, y = extended_euclidean(b, a % b)
        return (y, x - (a // b) * y)
```

